import ExpenseItem from "./components/ExpenseItem";
function App() {
  const expenses = [
    { title: "Loan", price: 294, date: new Date(2021, 2, 28) },
    { title: "Education", price: 300, date: new Date(2022, 10, 15) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title} price={expenses[0].price} date={expenses}  />
    </div>
  );
}

export default App;
